import logo from './logo.svg';
import './App.css';
import React from "react";
class App extends React.Component{

  constructor(props) {
    super(props);
    this.state = {apiResponse: ""};
  }

  callTimeAPI() {
    fetch("http://localhost:9000/gettime")
        .then(res => res.text())
        .then(res =>
        {
          this.setState({timeApiResponse: res})
        });
  }

  render() {
    return (
        <div>
          {this.state.apiResponse}
        </div>
    );
  }
}

export default App;
